  What will be returned by the following method call in the same class?
  max(max(matrix[2 ]),  max(matrix[3 ])) Choices: a) 9  b) 8  c) 7  d) 4  
 Output:
 First,  I need to find the maximum value in the third row of the matrix,  which is matrix[2].  To do this,  I will call the private method max(int[] array) with the third row as the argument.  The third row is [5,  7,  7,  6],  so max(matrix[2]) will return the maximum value in this array,  which is 7.
 Next,  I need to find the maximum value in the fourth row of the matrix,  which is matrix[3].  To do this,  I will call the private method max(int[] array) with the fourth row as the argument.  The fourth row is [1,  2,  3,  4],  so max(matrix[3]) will return the maximum value in this array,  which is 4.
 Now,  I need to compare these two maximum values using the public method max(int num1,  int num2).  The method will return the larger of the two values,  which is 7.
